interface IProps {
    setWcComponentState: Dispatch<SetStateAction<string>>
}

const WcProceedingContainer = ({ setWcComponentState }: IProps) => {
    const [animals, setAnimals] = useState<object[]>([]);
    const [displays, setDisplays] = useState<object[]>([]);
    const [winners, setWinners] = useState<object[]>([]);
    const [worldCupstate, setWorldCupstate] = useState(items.length);

    useEffect(() => {
        items.sort(() => Math.random() - 0.5);
        setAnimals(items);
        setDisplays([items[0], items[1]]);
    }, []);

    const clickHandler = (animal: any) => (event: MouseEvent<HTMLDivElement>) => {
        event.currentTarget.classList.add("click__active")
        setTimeout(() => {
            if (animals.length <= 2) {
                if (winners.length === 0) {
                    setDisplays([animal]);
                    setWcComponentState("complate")
                } else {
                    let updataAnimals = [...winners, animal];
                    setAnimals(updataAnimals);
                    setWorldCupstate(updataAnimals.length)
                    setDisplays([updataAnimals[0], updataAnimals[1]]);
                    setWinners([]);
                }
            } else if (animals.length > 2) {
                setWinners([...winners, animal]);
                setDisplays([animals[2], animals[3]]);
                setAnimals(animals.slice(2));
            }
            document.querySelector('.click__active')?.classList.remove("click__active")
        }, 1000)
    };
    return (
        <WcProceedingPresenter
            clickHandler={clickHandler}
            worldCupstate={worldCupstate}
            displays={displays}
        />
    )
};

export default WcProceedingContainer;